import Title from "./Title";
import Desc from "./Desc";
import "./title.css";

export default function Text(props) {
        return (
            <div className="text-box">
            <Title className="text-title" title={props.title} logo={props.logo}></Title>
            <Desc className="text-desc" desc={props.desc}/>
            </div>
           );
}
